import { Card, Container, makeStyles, CardContent } from "@material-ui/core"

const useStyles = makeStyles((theme) => ({
  container: {
    marginTop: theme.spacing(4),
  },
}))

const FeedPage = () => {
  const classes = useStyles()
  return <Container className={classes.container} maxWidth="md"></Container>
}

export default FeedPage
